import React from 'react'
import Elements from './Elements'
import items from './ElementsData'

/*
This is a method where the values are coming from the data file where any number of items can be included.
we then add these elements using the map function. lets call this as equation (1) */

function Card() {

  const elementsDetails = items.map(items => {
    return (
      <Elements
        id= {items.id}
        img= {items.img}
        type= {items.type}
        city={items.city}
        saledeadline={items.saledeadline}
      />
    )
  })

  return (
    <div className='card-div'>
      {elementsDetails}
    </div>
  )
}

export default function MainContent() {
  return (
    <div className='main'>
      <h1>We Offer!!</h1>
      <Card />
      <span>
        <h1>Register Today!!</h1>
        <p>We have what you need!! Rent Anything, Anywhere!</p>
      </span>
    </div>
  );
}
